import styled, { ThemeProvider } from 'styled-components';
import CommonBtn from './components/CommonBtn';
import theme from './resource/css/theme';

function App() {
    return (
        <>
            <ThemeProvider theme={theme}>
                <CommonBtn border="red" />
            </ThemeProvider>
        </>
    );
}

export default App;
